import React, { Component } from 'react';
import './Home.css';
import Feature from './Features';
import twitterBird from './images/twitter-bird.png';

export class Home extends Component {
	render() {
		return (
			<div>
				<h1 className="homepage-heading ">Hunt üèπ Tweets</h1>
				<div className="homepage-body">
					<img className="homepage-img" src={twitterBird} alt="twitter birds" />
					<div>
						<Feature>
							<h4 className="feature-1">Go to Search Tweets section to search up any tweet</h4>
						</Feature>
						<Feature className="feature-2">Go to Random section to get a random tweet from my favorites</Feature>
						<Feature className="feature-3">Enjoy hunting down tweets you like!</Feature>
					</div>
				</div>
			</div>
		);
	}
}

export default Home;
